(184, 'LITA (ALMERITA TEIXEIRA LIMA)', '6689-12 008.02', 'R.BERNARDO GUIMARAES -1130/301', 'FUNCIONARIOS', '30140-081', 'BELO HORIZONTE', 'MG', '031', '225.8100', '', '0313', '213.9723', '20/5/1900', 'CELULAR LITA :9950 1093   - ge : 3281 7815 -Proc; 2003.38.00.002480-1\r\nPAIS: 34 3333 3405 -REGINA(IRMA)- 34 3813 1414-HOSPITAL:34 3813 0800\r\nGABRIEL LUIZ JUNQUEIRA PEDRAS : 021 205 5766/021 9985 2164(CELULAR)\r\nGABRIEL COMERCIAL : 021 297 1222  - 021 262 3654\r\nFORJAS BRASILEIRAS S/A : 021 262 3654 (DIRETO GABRIEL)\r\nPRIMA LÚCIA - 223 6023 (CONSULTÓRIO) - LUCIA LIMA MEDEIROS - CEL:9618 \r\n6023  - MARGARETH : 3463 7090 - 3442 1003 - 9605 0657\r\nMEDICO : DR. GARIBALDE :3275 1526 (GARI)  - RES.281 1178 -CONTORNO 8000 \r\nSALA 1304 - SANTO AGOSTINHO  cep: 30110.120 - CEL - 9196 7249\r\nPAI: JOÃO TEIXEIRA DE MORAIS - AV.LEOPOLDINO DE OLIVEIRA, 2925, 16ºANDAR\r\n38015-000 - U B E R A B A - MG\r\nSOBRINHA : FABIOLA : 3226 8810  - CELULAR: 8809 6886\r\nAMIGA - MARIÂNGELA : 3296 3465 - UFMG : 3499 2839 - 8798 1542- \r\nAMIGA \r\nMARIA ANGELICA : 3281 7815 - 3291 5272\r\nAMIGA - MARTA : CATOLICA: 3319 4996 - RES:3262 2877 - 9104 6757\r\nIRMÃ REGINA : HOSPITAL CRISTO REI LTDA -RUA PEREIRA GUIMARAES - 621 - \r\nVAZANTE - MG -CEP: 38780.000 - FONE: 34 3813 0800 - RES: 3813 1414\r\nIRMã MEIRE : FAZENDA GUATAPARÁ - CASTILHO/SP - FONE 18 3721 1242 - \r\nTRABALHO : INSS ANDRADINA : 18 3722 2906  - unibanco : 3377 6899\r\n........................................................................\r\nNO MAR,TANTA TORMENTA, TANTO DANO,\r\nTANTAS VEZES A MORTE APERCEBIDA.\r\nNA TERRA, TANTA GUERRA,TANTO ENGANO,\r\nTANTA NECESSIDADE ABORRECIDA.\r\nONDE ABRIGAR-SE UM FRACO HUMANO,\r\nONDE TER SEGURA A PROPRIA VIDA? (Luis de Camões)\r\n----------------------------------------------------------------------- \r\nO MEU NOME É SEVERINO\r\nNÃO TENHO OUTRO DE PIA\r\nMAS COMO HÁ TANTOS SEVERINOS \r\nQUE É SANTO DE ROMARIA\r\nDERAM ENTÃO DE ME CHAMAR \r\nSEVERINO DE MARIA\r\nCOMO HÁ MUITOS SEVERINOS\r\nCOM MÃES CHAMADAS MARIAS\r\nFIQUEI SENDO O SEVERINO \r\nDA MARIA DO ZACARIAS.\r\n\r\nMAS ISSO AINDA DIZ POUCO\r\nHÁ MUITOS NA FREGUESIA\r\nPOR CAUSA DE UM CORONEL\r\nQUE SE CHAMOU ZACARIAS\r\nE QUE FOI O MAIS ANTIGO\r\nSENHOR DESSAS SESMARIAS\r\n\r\nCOMO ENTÃO DIZER QUEM FALA\r\nORA A VOSSAS SENHORIAS?\r\nVEJAMOS: É O SEVERINO DA MARIA\r\nDO FINADO ZACARIAS\r\nLA DA SERRA DA COSTELA\r\nLIMITE DA PARAÍBA.\r\n\r\nMAS ISSO AINDA DIZ POUCO\r\nSE PELO MENOS MAIS CINCO HAVIA\r\nCOM NOMES DE SEVERINO\r\nFILHOS DE TANTAS MARIAS\r\nMULHERES DE OUTROS TANTOS\r\nJA FINADOS ZACARIAS.\r\n\r\nSOMOS MUITOS SEVERINOS\r\nIGUAIS EM TUDO E NA VIDA\r\nNA MESMA CABEÇA GRANDE\r\nQUE A CUSTO E QUE SE EQUILIBRA\r\nNO MESMO VENTRE CRESCIDO\r\nSOBRE AS MESMAS PERNAS FINAS\r\nE SOMOS IGUAIS PORQUE O SANGUE\r\nQUE USAMOS TEM POUCA TINTA.\r\n\r\nE SE SOMOS SEVERINOS\r\nIGUAIS EM TUDO E NA VIDA\r\nMORREMOS DA MESMA MORTE\r\nMORTE E VIDA SEVERINA\r\nQUE É A MORTE DE QUE SE MORRE\r\nDE VELHICE ANTES DOS TRINTA\r\nDE EMBOSCADA ANTES DOS VINTE\r\nDE FOME UM POUCO POR DIA\r\nDE FRAQUEZA E DE DOENÇA\r\nÉ QUE A MORTE SEVERINA\r\nATACA EM QUALQUER IDADE\r\nE ATÉ GENTE NÃO NASCIDA.\r\n\r\nSOMOS MUITOS SEVERINOS\r\nIGUAIS EM TUDO E NA VIDA\r\nA DE ABRANDAR ESSAS PEDRAS\r\nSUANDO-SE MUITO EM CIMA\r\nA DE TENTAR DESPERTAR\r\nTERRA QUASE SEMPRE EXTINTA\r\nA DE QUERER ARRANCAR\r\nALGUM ROÇADO DA CINZA\r\n\r\nMAS PARA QUE MELHOR ME CONHEÇAM\r\nVOSSAS SENHORIAS\r\nE MELHOR POSSAM SEGUIR\r\nOS PASSOS DA MINHA HISTÓRIA\r\nSOU APENAS O SEVERINO\r\nQUE EM VOSSA PRESENÇA EMIGRA.(JOÃO CABRAL DE MELO NETO)\r\n-----------------------------------------------------------------------\r\nDE TUDO AO MEU AMOR SEREI ATENTO\r\nANTES, E COM TAL ZELO E SEMPRE E TANTO,\r\nQUE MESMO EM FACE AO MAIOR ENCANTO\r\nDELE SE ENCANTE MAIS O MEU PENSAMENTO.\r\n\r\nQUERO VIVÊ-LO EM CADA VÃO MOMENTO,\r\nE EM SEU NOME HEI DE ESPALHAR O MEU CANTO\r\nE RIR MEU RISO E DERRAMAR MEU PRANTO\r\nAO SEU PESAR AO SEU CONTENTAMENTO.\r\n\r\nE ASSIM MAIS TARDE, QUANDO ME PROCURE\r\nQUEM SABE A MORTE, ANGUSTIA DE QUEM VIVE,\r\nQUEM SABE A SOLIDÃO O FIM DE QUEM AMA\r\n\r\nEU POSSA LHE DIZER DO AMOR QUE TIVE\r\nQUE NÃO SEJA ETERNO, POSTO QUE É CHAMA\r\nMAS QUE SEJA INFINITO ENQUANTO DURE. (VINICIUS DE MORAES)\r\n\r\n--------------------------------------------------------------------------\r\n\r\n\r\nCOM MINHA MAE ESTAREI\r\nNA SANTA GLORIA UM DIA\r\nJUNTO À VIRGEM MARIA\r\nNO CEU TRIUNFAREI\r\n\r\nNO CÉU, NO CÉU, COM MINHA MAE ESTAREI\r\nNO CÉU, NO CÉU, COM MINHA MAE ESTAREI.\r\n\r\nCOM MINHA MAE ESTAREI\r\nMAS JÁ QUE HEI OFENDIDO\r\nAO MEU JESUS QUERIDO\r\nAS CULPAS CHORAREI\r\n\r\nNO CÉU, NO CÉU ...\r\n\r\nCOM MINHA MAE ESTAREI\r\nPALAVRA DELICIOSA\r\nQUE EM HORA TRABALHOSA\r\nFIEL RECORDAREI\r\n\r\nNO CÉU, NO CÉU, ...\r\n\r\nCOM MINHA MAE ESTAREI,\r\nPOR VÓS VIRGEM DA GLÓRIA\r\nPENHOR DESTA VITORIA\r\nÀ PÁTRIA CHEGAREI.\r\n\r\nNO CÉU, NO CÉU, ...\r\n\r\nCOM MINHA MAE ESTAREI\r\nAOS ANJOS ME AJUNTANDO\r\nDO ONIPOTENTE AO MANDO\r\nHOSANAS  LHE DAREI\r\n\r\nNO CÉU, NO CÉU ...\r\n\r\nCOM MINHA MAE ESTAREI,\r\nENTAO COROA DIGNA\r\nDE SUA MAO BENIGNA\r\nFELIZ RECEBEREI\r\n\r\nNO CÉU, NO CÉU,...\r\n\r\nCOM MINHA MAE ESTAREI\r\nE SEMPRE NESTE EXÍLIO\r\nDE SEU PIEDOSO AUXILIO\r\nCOM FÉ ME VALEREI\r\n\r\nNO CÉU, NO CÉU, COM MINHA MAE ESTAREI\r\nNO CÉU, NO CÉU, COM MINHA MAE ESTAREI.\r\n\r\nCOLABORAÇÃO DA ANA CLÁUDIA\r\n\r\nBATATINHA QUANDO NASCE\r\nESPALHA RAMAS PELO CHÃO\r\nA MENINA QUANDO DORME\r\nPÕE A MÃO NO CORAÇÃO\r\n\r\n\r\n', '2', '2018-02-04 10:25:29', NULL),
