(1323, 'STRESS - 89 MANEIRAS DE EVITAR', 'VEJA CAMPO  MEMO', '', '', '', '', '', '', '', '', '', '', '30/12/1899', '- OITENTA E NOVE MANEIRAS DE EVITAR O STRESS:\r\n. acorde mais cedo\r\n. planeje-se com antecedência\r\n. evite preocupaçoes\r\n. evite ajuda quimica\r\n. faça reuniões objetivas\r\n. anote tudo\r\n. pratique manutenção preventiva\r\n. faça duplicata das chaves\r\n. diga não mais frequentemente\r\n. estabeleça prioridades\r\n. evite pessoas negativas\r\n. use o tempo sabiamente\r\n. simplifique refeições\r\n. copie documentos importantes\r\n. antecipe necessidades\r\n. faça consertos\r\n. obtenha ajuda em trabalhos dos quais voce não goste\r\n. encare problemas como desafios\r\n. alivie a sua vida\r\n. sorria\r\n. prepare-se para a chuva\r\n. nine uma criança\r\n. tenha um gato ou um cachorro\r\n. não saiba todas as respostas\r\n. diga alguma coisa legal\r\n. chegue ao trabalho mais cedo\r\n. arrume um armario\r\n. brinque com uma criança\r\n. vá a um pic nic\r\n. ensine uma criança a empinar pipa\r\n. ande na chuva\r\n. planeje o tempo de lazer\r\n. tome um banho de espuma\r\n. esteja consciente de suas decisoes\r\n. acredite em si\r\n. pare de falar negativamente\r\n. desenvolva seu senso de humor\r\n. tenha visao de vencedor\r\n. veja um filme comendo pipoca\r\n. escreva para um amigo\r\n. grite num jogo de futebol\r\n. jante à luz de velas\r\n. perceba o valor do amor incondicional\r\n. lembre-se de suas opções\r\n. deixe de tentar consertar os outros\r\n. durma o suficiente\r\n. fale menos e ouça mais\r\n. elogie pessoas\r\n. vá de encontro às suas necessidades\r\n. conheça seus limites\r\n. faça um aviãozinho de papel\r\n. exercite-se\r\n. aprenda uma nova canção\r\n. tome um caminho diferente para o trabalho\r\n. deixe o trabalho mais cedo\r\n. ponha um odorizador no seu carro\r\n. pare de pensar que amanhã será melhor\r\n. estabeleça objetivos\r\n. dance\r\n. cumprimente um desconhecido\r\n. abrace um amigo\r\n. olhe para as estrelas\r\n. respire lentamente\r\n. assobie\r\n. leia um poema\r\n. escute uma sintonia\r\n. assista um balé\r\n. leia uma historia\r\n. faça alguma coisa nova\r\n. pare com um mau hábito\r\n. compre flores\r\n. sinta o perfume das flores\r\n. encontre apoios\r\n. faça hoje\r\n. seja otimista\r\n. ponha a segurança em primeiro lugar\r\n. faça as coisas com moderação\r\n. preste atençao em sua aparência\r\n. esforce-se para a excelência, não para a perfeição\r\n. alongue seus limites\r\n. aprecie a arte\r\n. cantarole um jingle\r\n. mantenha seu peso\r\n. plante uma árvore\r\n. alimente pássaros\r\n. tenha uma segunda opção\r\n. aprenda uma piada\r\n. conheça seus sentimentos.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '2', '2018-02-04 10:26:32', NULL),
